Mission Statement
——————————————————————————–
In the 21st century\, we’ve seen a massive upsurge in technologies being used for both nefarious and liberatory purposes. Many of these technologies have been utilized for organizing\, but we believe their full potential has yet to be reached. Many of the platforms used are maintained and surveilled by our enemies\, and their practical applications as organizing tools are coincidentally rather than primary intentions.
It is the goal of this group to build technology for the revolution with anarchist principles. Science and technology serve whomever utilizes them\, thus we shouldn’t allow our enemies to have a monopoly on them.
If you’re a programmer\, designer\, IT specialist\, NetSec pro\, or anyone with a knack for technology\, and you believe in the building a world without state\, class\, money\, or borders\, come join us to hack the revolution!
while(state || capitalism || white_supremacy || patriarchy) {
agitate()\;
educate()\;
organize()\;
revolt()\;
}
Collective Guidelines
——————————————————————————–
This group organizes around anarchist principles. It exists to complement other organizing tactics/strategies\, or to open new avenues through technology. To this end\, this group does not exist to further one’s career. We will not take personal credit for the projects\, and we will not attempt to profit from any technology created in this group. Everything we create will be open source so that others can benefit from it.

